import React from 'react';
import { Grid, Paper } from '@material-ui/core';

export default props => {
  return (
    <Grid container>
      <Grid item>
        Left Pane
      </Grid>
      <Grid item>
        Right Pane
      </Grid>
    </Grid>
  );
}
